import "./bugform.css"
import {Button, FloatingLabel, Form, FormGroup} from "react-bootstrap";
import {useState} from "react";

const BugForm = () => {
    const [bugData, setBugData] = useState({
        name: "",
        description: "",
        priority: ""
    })
    const onBugDataChange = (event) => {
        setBugData(prevState => {
            return ({
                ...prevState,
                [event.target.name]: event.target.value
            })
        })
    }
    const onAddBugClicked = ()=>{
        console.log(bugData)
    }
    return <div id={"bug-form-container"}>
        <Form>
            <FormGroup className={"mb-3"}>
                <FloatingLabel label={"Name"} className={"mb-3"}>
                    <Form.Control type={"text"} placeholder={"Name"} onChange={onBugDataChange}></Form.Control>
                </FloatingLabel>
                <FloatingLabel label={"Description"} className={"mb-3"}>
                    <Form.Control type={"text"} placeholder={"Description"} onChange={onBugDataChange}></Form.Control>
                </FloatingLabel>
                <Form.Select style={{width: "40%"}} size={"sm"} aria-label={"Default"}>
                    <option value={"LOW"}>Low</option>
                    <option value={"MEDIUM"}>Medium</option>
                    <option value={"HIGH"}>High</option>
                </Form.Select>
            </FormGroup>
            <Button>Add bug</Button>
        </Form>
    </div>
}
export default BugForm
